ementa:
Requer a realização de Audiência Pública desta Comissão Especial para debater a respeito da adoção de competência legal de investigação em todas as polícias, com a presença dos seguintes convidados:
1.	Rodrigo Foureaux, Juiz de Direito do Tribunal de Justiça do Estado de Goiás;
2.	Janice Goulart Garcia Ubialli, Desembargadora Coordenadora do Sistema dos Juizados Especiais e do Núcleo Permanente de Métodos Consensuais de Solução de Conflitos;
3.	Renata Gil de Alcantara Videira, Presidente da Associação dos Magistrados Brasileiros - AMB;
4.	Tenente Coronel José Eufrásio Barreto, autor do Livro Ciclo Completo de Polícia - as gendarmarias brasileiras e o modelo de eficiência policial;
5.	Coronel Aílton Cirilo da Silva, Presidente da Associação dos Oficiais da Polícia Militar e Corpo de Bombeiros Militar do Estado de Minas Gerais - AOPMBM; e
6.              Subtenente Heder Martins de Oliveira, Presidente da Associação dos Praças Policiais e Bombeiros Militares de Minas Gerais. NA

Requer a realização de Audiência Pública, para debater as Políticas de Transferência de Renda: Bolsa Família, Avanços e Desafios no Brasil, com os seguintes convidados: 
Osmar Terra, Ministro do Ministério da Cidadania;
Paloma Arnos Caseiro, Diretora do Banco Mundial no Brasil; 
Ricardo Henriques, Superintendente Executivo do Instituto Unibanco;
Carlos Von Doellinger, Presidente do Instituto de Pesquisa Econômica Aplicada. NA

Requer realização de audiência pública para discussão sobre o histórico do Programa Bolsa Família no Brasil.
Nesse sentido, convida-se para debater o tema:
a)	Atual Coordenadora de Estudos de Responsabilidade Social do IPEA e Coordenadora do Grupo de Pesquisa em Nutrição e Pobreza do IEA/USP. Ex-Secretária-Executiva da Comunidade Solidária. Foi Coordenadora do Núcleo de Estudos da Fome da UnB e da elaboração do Mapa da Fome. Participou como membro da Sociedade Civil no Consea, Anna Maria Medeiros Peliano;
b)	Pesquisadora associada ao Grupo Pobreza e Políticas Sociais da Clacso e ao Instituto de Ciência Política da Universidade de Brasília, foi conselheira do Conselho Nacional de Assistência Social e Assessora Especial do Ministério do Desenvolvimento Social e Combate a Fome, Luciana Jaccoud;
c)	É professora Titular da Escola de Serviço Social da Universidade Federal do Rio de Janeiro (ESS/UFRJ) e vice-líder do Grupo de Estudos e Pesquisas Marxistas sobre Política Social (GEMPS/UFRJ).Realiza pesquisas na área de Políticas Sociais e Serviço Social, com ênfase em formação profissional, trabalho, seguridade social, assistência social, proteção social, direitos sociais e orçamento público. Autora de vários livros e dezenas de artigos sobre política social, seguridade social e trabalho e serviço social. Pesquisadora 1B do CNPq. Ex-Presidente da ABEPSS, e do Conselho Federal de Serviço Social (CFESS), Ivanete Boschetti;
d)	Secretário do Tesouro Nacional e técnico de Planejamento e Pesquisa do Instituto de Pesquisa Econômica Aplicada (IPEA). Foi coordenador-geral de Política Monetária e Financeira na Secretaria de Política Econômica no Ministério da Fazenda e Secretário na Secretaria de Acompanhamento Econômico (SEAE) do Ministério da Fazenda, Mansueto Facundo de Almeida Júnior;
e)	Secretário de Política Econômica no Ministério da Economia, Adolfo Sachsida;
f)	Presidente do Fórum Nacional de Secretários(as) de Estado da Assistência Social (FONSEAS), Elisa Cleia Pinheiro Rodrigues Nobre;
g)	Foi pesquisador associado na Fundação Getúlio Vargas e no Banco Mundial. Realizou pesquisas nas áreas de política econômica, energética, social e educacional, Vinícius Botelho. NA

Requer Audiência Pública para debater a matéria concernente às relações trabalhistas contida no Projeto de Lei Complementar nº 146, de 2019, que "dispõe sobre startups e apresenta medidas de estímulo à criação dessas empresas e estabelece incentivos aos investimentos por meio do aprimoramento do ambiente de negócios no País", com a presença dos seguintes convidados:
1. Representante do Sindicato dos Auditores Fiscais do Trabalho;
2. Representante do Ministério Público do Trabalho;
3. Representante do Tribunal Superior do Trabalho;
4. Representante Associação Nacional dos Magistrados da Justiça. NA

Requer realização de audiência pública para discussão sobre "Definição legal de startups: parâmetros e/ou critérios de definição".
Sugiro que sejam convidados, para apreciação do tema, os seguintes convidados:
a) Amure Pinho da Rocha e Silva, Associação Brasileira de Startups.
b) Igor Manhães Nazareh, Subsecretário de Inovação no Ministério da Economia;
c) Rodolfo Fucher, Presidente da ABES - Associação Brasileira de Empresas de Software;
d) Representante da Câmara e-Net;
e) Representante da Associação de Mobilidade e Tecnologia (AMOBITEC); e 
f) Rodrigo "Kiko" Afonso, Dínamo. NA

Requer a realização de audiência pública para discutir sobre "O papel dos Institutos de Ciência e Tecnologia (ICTs) no estímulo à criação de startups: formação de talentos, educação empreendedora e transferência de tecnologia".
Convidados a comparecer em reunião de Audiência Pública: 
1. Prof. Jorge Nicolas Audy - representando da Superintendência de Inovação e Desenolvimento (SID) da PUCRS;
2. Profª Rafaella Kalil - representante de Ecossistema de Empreededorismo e Inovação de unidade educacional do Grupo Afya;
3. Representante do MEC;
4. Representante da Associação Nacional de Pesquisa e Desenvolvimento das Empresas Inovadoras (ANPEI). NA

Requer Audiência Pública para discutir e debater sobre o PL 1.440/2019. 
Convidados:
1 - José Carlos Mendonça, professor da UENF;
2 - Eduardo Crespo, Vereador no Município de Campos dos Goytacazes/RJ;
3 - Frederico Paes, presidente do Sindicato da Indústria Sucroenergética do Estado do Rio (SISERJ) e presidente da Coagro (Cooperativa Afroindustrial do Estado do Rio de Janeiro);
4- Ex-senador da República Eduardo Lopes, pelo Estado do Rio de Janeiro. NA

